        // parsing and collecting nodes and edges from the python
        nodes = new vis.DataSet([{"color": "#377eb8", "id": "1929-1965_gress_342", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDen alene fornam blodet. \u2666 Bekken, hvori Kristen Storstu vasket\u003cbr\u003esine blodv\u00e5te fing* rer, var den koldeste i dalen. Fra bratteste\u003cbr\u003egroven kom den, ut av bl\u00e5e berget i strak, iskold str\u00f8m; boblet og\u003cbr\u003eskummet i skogvill latter mellem r\u00f8d sten og hvit sten, hvor\u003cbr\u003eorme\u003cb\u003egress\u003c/b\u003e vokste frodig over; smatt under trerot og hemmelig\u003cbr\u003egressvoll fremved skigarden \u00f8verst i Storstujordet; drog s\u00e5 i strak og\u003cbr\u003estr\u00f8m jordet nedover, i sving forbi vassstroen og fremover til gjerdet\u003cbr\u003eved aJlmannveien, dypt gjemt i gress med blom av karve og hundekjeks\u003cbr\u003eog kr\u00e5kefot og en og annen kvannrotstjelk iblandt.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_gress_342\u003cbr\u003etype: usage\u003c/p\u003e", "x": 321.9703842303693, "y": 562.0394455303048}, {"color": "#377eb8", "id": "1970-2015_gress_98", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eFor detaljene omkring avh\u00f8ret vises det til redegjorelsen\u003cbr\u003eovenfor i punkt 3.4.2.5. 112 Utvalget viser her ogs\u00e5 til vedlegg til\u003cbr\u003eSandberg 2000 Torunn-saken, vitneforklaring fra JEH og AH avgitt til\u003cbr\u003eTore Sandberg 23. september 1999. 113 Sandberg 2000 Torunn-saken side\u003cbr\u003e82. Fritz Moen og norsk strafferettspleie =i Kapittel 4 Imidlertid\u003cbr\u003ef\u00f8lger det av \u00e5stedsrapporten at \u003cb\u003egresset\u003c/b\u003e p\u00e5 hele sletten ble\u003cbr\u003esl\u00e5tt den 19. og 20. oktober 1977, alts\u00e5 f\u00f8r f\u00f8rste rekonstruksjon 24.\u003cbr\u003eoktober 1977. 117 Politibetjent Torbj\u00f8rn Kalland har forklart til\u003cbr\u003eutvalget at alle band og lapper var fjernet under begge\u003cbr\u003erekonstruksjonene.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_gress_98\u003cbr\u003etype: usage\u003c/p\u003e", "x": 461.426669169556, "y": 14.681909899774363}, {"color": "#377eb8", "id": "1970-2015_gress_29", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eReiret bygges av hunnen og fores med t\u00f8rt \u003cb\u003egress\u003c/b\u003e og fine\u003cbr\u003estr\u00e5. Vanligvis legges 4-5 egg som ruges av hunnen i 12-14 d\u00f8gn.\u003cbr\u003eEggene varierer sterkt i farge, noe som tyder p\u00e5 at arten er utsatt\u003cbr\u003efor sterk parasittering av gj\u00f8k.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_gress_29\u003cbr\u003etype: usage\u003c/p\u003e", "x": -236.94913295334192, "y": 385.27448138217125}, {"color": "#377eb8", "id": "1929-1965_gress_438", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEn behagelig nyhet, der som ild i vissent \u003cb\u003egress\u003c/b\u003e\u003cbr\u003eforplantet seg til passasjerene p\u00e5 alle tre plasser:\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_gress_438\u003cbr\u003etype: usage\u003c/p\u003e", "x": 227.4628693005001, "y": -244.35263117866313}, {"color": "#377eb8", "id": "1970-2015_gress_20", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eSom ild i t\u00f8rt \u003cb\u003egress\u003c/b\u003e! Hvorfor er det billede s\u00e5 godt?\u003cbr\u003eFordi gresset var t\u00f8rt, det hadde ikke mere av de livgivende safter i\u003cbr\u003esig . . .\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_gress_20\u003cbr\u003etype: usage\u003c/p\u003e", "x": 695.1606059732842, "y": 88.33211122291061}, {"color": "#377eb8", "id": "1929-1965_gress_399", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eBlomster og skog og \u003cb\u003egress\u003c/b\u003e ga oss sin vekst og fred, s\u00e5\u003cbr\u003evi m\u00e5 bl\u00f8 med alt liv som blir trampet ned. Dyp er v\u00e5rt hjemlands\u003cbr\u003emuld. Hemmelig er vi ett med hver en sorg som gror. Men det er ikke\u003cbr\u003erett. For vi har tapt v\u00e5rt land, tapt det fra hav til fonn. Og skal vi\u003cbr\u003evinne det, skjer ikke det ved \u00e5nd. Her er v\u00e5rt land: En \u00f8y. Blesten\u003cbr\u003eg\u00e5r strid og kald.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_gress_399\u003cbr\u003etype: usage\u003c/p\u003e", "x": 58.22441630787911, "y": -90.55218276850051}, {"color": "#377eb8", "id": "1929-1965_gress_51", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eLlgen nar ogBa en av sine beste trakter pa Oplandene ner. og\u003cbr\u003emangen en Btolt bringe nar mattet bite i \u003cb\u003egresset\u003c/b\u003e om liksten,\u003cbr\u003ebade kor innenbvgdB og utenbvgdB skvttere. sa kelt kra \u0027lvskland er de\u003cbr\u003ekommet na og da. Ja, n\u00e5 kom jeg nok langt bort fra det egentlige\u003cbr\u003eseterbruk; men multsanking, fiske og jakt h\u00f8rer ogs\u00e5 seterlivet til,\u003cbr\u003eog selv om det \u00f8konomiske utbytte ikke alltid er s\u00e5 stort, fortjener\u003cbr\u003edet dog sin omtale. Nu f\u00e5r vi se \u00e5 finne igjen Bernt. .\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_gress_51\u003cbr\u003etype: usage\u003c/p\u003e", "x": -253.86174248693246, "y": -750.0}, {"color": "#377eb8", "id": "1970-2015_gress_182", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eGundersen, Kr.sund hadde imidlertid d\u00e5rlige erfaringer med\u003cbr\u003e\u003cb\u003egress\u003c/b\u003e i sektorene.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_gress_182\u003cbr\u003etype: usage\u003c/p\u003e", "x": -443.4328905361795, "y": -456.52782292079166}, {"color": "#377eb8", "id": "1929-1965_gress_225", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eElva bukter seg med de samme flate breddene p\u00e5 to sider.\u003cbr\u003eNederst den lang-grunne sand-stranda, ofte med sm\u00e5stein, s\u00e5 kommer en\u003cbr\u003ebratt skr\u00e5ning dannet av sand og grus, s\u00e5 et stykke h\u00f8yere den skarpe\u003cbr\u003erand hvor \u003cb\u003egress\u003c/b\u003e og mose og skogen begynner. Opp hit er det elva\u003cbr\u003estiger hver v\u00e5r, og forskjellen i h\u00f8yde kan vaere mere enn 10 m. Det\u003cbr\u003eer p\u00e5fallende hvor meget h\u00f8yere og brattere den \u00f8stre elve-bredden er\u003cbr\u003eenn den vestre overalt her oppetter. Som jeg f\u00f8r har sagt, kan det\u003cbr\u003eikke i dette str\u00f8k, hvor alt er l\u00f8st materiale, skyldes annet enn\u003cbr\u003evirkninger av Jordens omdreining\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_gress_225\u003cbr\u003etype: usage\u003c/p\u003e", "x": 426.9515658261392, "y": 295.38706606066484}, {"color": "#377eb8", "id": "1929-1965_gress_415", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eFRELSNINGSARKEN Stinn og lutrygget gikk Benjamin Johanna p\u00e5\u003cbr\u003eArn\u00f8iholmen ovenom flom\u00e5let og skar \u003cb\u003egress\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_gress_415\u003cbr\u003etype: usage\u003c/p\u003e", "x": 146.28134571557555, "y": -604.8745007554161}, {"color": "#377eb8", "id": "1970-2015_gress_8", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI l\u00f8pet av tre \u00e5r og 650 dugnadstimer ble skog hogget, matjord\u003cbr\u003ekj\u00f8rt p\u00e5 og \u003cb\u003egress\u003c/b\u003e s\u00e5dd langs bredden. Bunnen ble ryddet og\u003cbr\u003edekket med sterk plastduk f\u00f8r 300 m 3 sand ble fylt p\u00e5. Toalett-bygg\u003cbr\u003eble satt opp og parkeringsplasser anlagt. Vei fram ble bygget i\u003cbr\u003eforbindelse med anlegg av ny kraftlinje. Struperud\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_gress_8\u003cbr\u003etype: usage\u003c/p\u003e", "x": -622.1843524013282, "y": 49.4622771939112}, {"color": "#377eb8", "id": "1970-2015_gress_171", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eNaerlekeplass, sandlekeplass 50 m 50 m indre sone: 50 Kvartals-\u003cbr\u003e1500 - 2000 m 2 lekeplass 25 - 200 150 m I+oo m 1000 m 2 Ballfelt 150\u003cbr\u003e- 600 grus-, asfaltdekke 3-5000 m 2\u003cb\u003e gres\u003c/b\u003es NTH, Inst. f:r by- og\u003cbr\u003eregionplanlegging\u003cspan style=\"color:#808080;\"\u003e:\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_gress_171\u003cbr\u003etype: usage\u003c/p\u003e", "x": -565.0039942307557, "y": 509.87230304893814}, {"color": "#377eb8", "id": "1929-1965_gress_378", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet str\u00e5lte op, da de nikket vennlig til ham og bad ham ta det\u003cbr\u003emed ro, for nu skulde de hjelpe ham med \u00e5 f\u00e5 kua op. \u00c5, han hadde\u003cbr\u003evaert s\u00e5 fortvilet! Blomros, bjellekua, hadde g\u00e5tt sig uti nu det\u003cbr\u003elakket mot kvelden og var evig langt til folk. Jan Didrik og\u003cbr\u003ebohusleningen tok tak fra hver sin kant, gjaeter gutten drog i halen,\u003cbr\u003eBlomros hjalp til s\u00e5 godt den kunde \u2014 og med et dypt sukk m\u00e5tte myren\u003cbr\u003egi slipp p\u00e5 sitt bytte. Blomros ristet litt p\u00e5 bakbenene, slo et par\u003cbr\u003eslag med halen, og gav sig s\u00e5 til \u00e5 rispe a\u003cb\u003ev gress\u003c/b\u003eet ved\u003cbr\u003emyrkante\u003cspan style=\"color:#808080;\"\u003en.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_gress_378\u003cbr\u003etype: usage\u003c/p\u003e", "x": 16.258370340053006, "y": 692.704107681811}, {"color": "#377eb8", "id": "1970-2015_gress_222", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eLekeplassen m\u00e5 dreneres grundig eventuelt med sluk, s\u00e5 ikke\u003cbr\u003esn\u00f8smelting, telel\u00f8sning, regnperioder og vannlek kan gj\u00f8re\u003cbr\u003elekeomr\u00e5det \u00fcbrukelig. Overflaten b\u00f8r varieres med f.eks. grus,\u003cbr\u003esingel, sand, jord, stein, tretremmer og \u003cb\u003egress\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_gress_222\u003cbr\u003etype: usage\u003c/p\u003e", "x": 461.9483009689365, "y": -210.1863191924053}, {"color": "#377eb8", "id": "1970-2015_gress_164", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eJordsmonnet var fruktbart if\u00f8lge en tidligere bonde jeg ble\u003cbr\u003ekjent med, og der hvor grunnen ikke var opptatt p\u00e5 annen m\u00e5te, fantes\u003cbr\u003etraer,\u003cb\u003e gres\u003c/b\u003es og andre planter. Noen folk dyrket visse planter\u003cbr\u003eog urter til medisinsk, gastronomisk og rituell bruk, mens andre\u003cbr\u003espirer og nytte - vekster vokste vilt\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_gress_164\u003cbr\u003etype: usage\u003c/p\u003e", "x": -28.03103982329664, "y": -369.05706683897813}, {"color": "#377eb8", "id": "1929-1965_gress_128", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDen f\u00f8r nevnte genius hadde sin fulle hyre, men ogs\u00e5 sin store\u003cbr\u003eforn\u00f8yelse disse dagene; det var riktig en \u00abdjevelens dansesal\u00bb den\u003cbr\u003eloset dem over. En dag oppe i iskl\u00f8ftene fant de vann. Nansens\u003cbr\u003eskildring formelig svulmer av lyrikk over de vannsvulmende maver. Den\u003cbr\u003e24 september var de endelig nede av isen og satte foten p\u00e5 b\u00e5r mark.\u003cbr\u003e\u00abOrd kan umulig beskrive hva det var for oss bare \u00e5 f\u00f8le jord og stein\u003cbr\u003eunder f\u00f8ttene, det velvaere som rislet gjennom oss ved \u00e5 f\u00f8le lyngen\u003cbr\u003eb\u00f8ye seg under s\u00e5len, og kjenne en vidunderlig duft av\u003cb\u003e gres\u003c/b\u003es og\u003cbr\u003emose\u00bb\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_gress_128\u003cbr\u003etype: usage\u003c/p\u003e", "x": 178.21927300783318, "y": 239.67517998957328}, {"color": "#377eb8", "id": "1970-2015_gress_172", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\"Man kan tenke seg at problemet best\u00e5r i \u00e5 finne frem til m\u00e5ter\u003cbr\u003e\u00e5 sl\u00e5\u003cb\u003e gres\u003c/b\u003es p\u00e5. Gruppelederen er den eneste som er klar over\u003cbr\u003eselve problemet, og m\u00e5 ikke r\u00f8pe det overfor gruppedeltakerne, men m\u00e5\u003cbr\u003ef\u00e5 dem til \u00e5 tale om beslektede problemer, f.eks. hvordan ting kan\u003cbr\u003eklippes over. Hensikten er at man ikke skal binde fantasien, samtidig\u003cbr\u003esom man skal s\u00f8ke \u00e5 utvikle en logisk og objektiv oversikt over\u003cbr\u003eproblemet. Gordon-teknikken vil vaere best anvendbar i prosjektets\u003cbr\u003einnledende faser mens problemstillingen fremdeles er noe ustrukturert,\u003cbr\u003eeventuell cgs\u00e5 for \u00e5 l\u00f8se opp problemer som har kj\u00f8rt seg fast. holder\u003cbr\u003etilbake alle negative reaksjoner, s\u00e5 som: \"\"La oss komme tilbake til\u003cbr\u003erealitetene\"\", \"\"Sjefen ville aldri g\u00e5 med p\u00e5 det\"\", eller \"\"Kunden er\u003cbr\u003eikke interessert i det\"\", \"\"Vi kan aldri f\u00e5 penger til det\"\", \"\"Vi har\u003cbr\u003eikke tid til \u00e5 tenke p\u00e5 det\"\", \"\"La noen andre fors\u00f8k\u003cspan style=\"color:#808080;\"\u003ee det\u003cbr\u003ef\u00f8rst\"\".\"\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_gress_172\u003cbr\u003etype: usage\u003c/p\u003e", "x": -452.62942925945356, "y": 173.8729820884098}, {"color": "#377eb8", "id": "1970-2015_gress_19", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eLa oss da et \u00f8ieblikk se hvad det var for en verden denne\u003cbr\u003ebevegelse kom til og hvordan det kan henge sammen at den fenger som\u003cbr\u003eild i t\u00f8rt \u003cb\u003egress\u003c/b\u003e . . .\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_gress_19\u003cbr\u003etype: usage\u003c/p\u003e", "x": 470.0417524003947, "y": -435.106709156598}, {"color": "#377eb8", "id": "1929-1965_gress_243", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet var en stor overraskelse \u00e5 se den store forandring som\u003cbr\u003elandskapet omkring Belusja*bay hadde underg\u00e5tt i den korte tid siden\u003cbr\u003esist vi var der. Hele \u00abg\u00e5selandet\u00bb var nu omtrent snebart og over de\u003cbr\u003esydvendte bakkeheld l\u00e5 der et gr\u00f8nnlig skjaer av det frem* spirende\u003cb\u003e\u003cbr\u003egres\u003c/b\u003es\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_gress_243\u003cbr\u003etype: usage\u003c/p\u003e", "x": -29.386222593066172, "y": 432.0960460258684}, {"color": "#377eb8", "id": "1929-1965_gress_141", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eJeg kan telle optil \u00e5tte hus herfr\u00e5 hvor jeg st\u00e5r, alle sammen\u003cbr\u003ebygd i kinesisk stil med krumme svaie tak og gr\u00f8nne, ildspyende drager\u003cbr\u003eav fajanse som snor sig langs m\u00f8nen mellem alle slags snirkler og\u003cbr\u003ekruseduller og blomster og \u003cb\u003egress\u003c/b\u003e av porselen. Bygningene ligger\u003cbr\u003eomkring et \u00e5ttekantet tempel eller en lav pagode, hvis underste tak\u003cbr\u003eblir st\u00f8ttet op av r\u00f8dmalte s\u00f8iler.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_gress_141\u003cbr\u003etype: usage\u003c/p\u003e", "x": -203.128670708192, "y": -213.69396224553577}, {"color": "#377eb8", "id": "1929-1965_gress_388", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eUndertiden har man ingen av de foran nevnte planter pa myren,\u003cbr\u003eenten fordi myren ikke har vaert skikket for frembrmgelse av s\u00e5dan\u003cbr\u003evegetasjon, eller fordi plantene er ddelagt ved sl\u00e5tt eller beitning.\u003cbr\u003eUnder slike forhold har det vist sig hensiktsmessig \u00e5 bedomme myrens\u003cbr\u003ekvalitet efter de\u003cb\u003e gres\u003c/b\u003es og urter som optrer,oe efter\u003cbr\u003eoverflatelagets struktur\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_gress_388\u003cbr\u003etype: usage\u003c/p\u003e", "x": -510.1102893405764, "y": -186.1156469826839}, {"color": "#377eb8", "id": "1970-2015_gress_2", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e3 Som seg en far s\u00e5 kjaerlig / forbarmer over sine sm\u00e5, / s\u00e5\u003cbr\u003elar v\u00e5r Gud oss herlig / sin n\u00e5de ny hver morgen f\u00e5. Han vet at vi er\u003cbr\u003esvake, / lik\u003cb\u003e gres\u003c/b\u003es som visner hen, / slett intet blir tilbake /\u003cbr\u003esom reiser seg igjen. Se, h\u00f8stens stormer jager / og feller skogens\u003cbr\u003etraer, / slik ender v\u00e5re dager, / v\u00e5r siste stund er naer. 4 Guds\u003cbr\u003emiskunnhet alene / st\u00e5r fast i tid og evighet / for dem som vil ham\u003cbr\u003etjene, / hans kjaere barn og menig\u003cspan style=\"color:#808080;\"\u003ehet.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_gress_2\u003cbr\u003etype: usage\u003c/p\u003e", "x": -119.22778890739784, "y": 117.06893191523457}]);
